import '../Nav/Nav.css';
import {Link} from 'react-router-dom';
import React, {useState} from 'react';
// import { BrowserRouter, Routes, Route } from 'react-router-dom';

function Nav() {
    return (
 <>
 <div>
    <div className="Nav">
            <div className="inner">
                <ul>
                    <li><Link to='/'>Home</Link></li>
                    <li><Link to='/Login'>Home &gt; Login</Link></li>
                    <li><Link to='/Order'>Home &gt; Order</Link></li>
                    <li><Link to='/Cart'>Home &gt; Cart</Link></li>
                    <li><Link to='/Qna'>Home &gt; Qna</Link></li>
                    <li><Link to='/Store'>Home &gt; Store</Link></li>
                </ul>
            </div>
        </div>
 </div>

</>
    );
}

export default Nav;
